import React from 'react';

export default class UseLocalStorage {

    setData(date: Date): string {
        // localStorage.setItem('patients', )
        return date.toString();
    }

    getGender(gender : string): string {
        return gender;
    }

    getAge(): number {
        return 50;
    }
}
